import React from "react";
import SearchBox from './SearchBox';
import {persons} from './persons';

class App extends React.Component{
    constructor(){
        super();
        this.state = { persons:[]}
    }

    render(){
        return (
            <div>
                <SearchBox />
            </div>
        )
    }
}

export default App;
